Documentary celebrating the founding of Ronnie Scott's 
Jazz club in 1959. Scott, a rising young saxophone player, 
opened a club where he and his friends could play the music 
they liked. Over the following years, the club had its ups 
and downs, reflecting the changes in attitudes to jazz and 
the social life of surrounding Soho.

Now Ronnie Scott's is known throughout the world as the 
hearbeat of British jazz. In this tribute, Omnibus talks to 
some of Ronnie's greatest admirers including Mel Brooks, the 
Rt Hon Kenneth Clarke MP and writer Alan Plater, and features 
rare archive footage of some of the club's historic 
performances by Zoot Sims, Sonny Rollins, Dizzy Gillespie and 
Ella Fitzgerald.
